import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {
  BrowserRouter as Router,
  Route
} from "react-router-dom"; 

import './css/index.min.css';

ReactDOM.render(
  <Router path="/">
     <Route exact path="/login">
      <h1>Login</h1>
    </Route>
    <Route>
      <App />
    </Route>
  </Router>,
  document.getElementById('root')
);
